import { useState } from 'react';
import '../css/Popup.css';
import ItemImage from './ItemImage.js';

export default function Popup(
    {   inactive,
        state,
        receiveData,
        sendData
    }) {
    // Step 1: Initialize state for input values
    const [inputValues, setInputValues] = useState({});

    const closePopup = () => {
        inactive(0);
    }

    const handleInputChange = (event, id, type) => {
        // Step 2: Update state on input change
        setInputValues({
            ...inputValues,
            [id]: {
                ...inputValues[id],
                [type]: event.target.value
            }
        });
    };

    const handleItemChange = () => {
        // Step 3: Access all input values
        console.log(inputValues);
        inactive(0);
    };

    let recipe_buy = [];
    if (receiveData["recipe"] != undefined) {
        receiveData["recipe"]["buy"].forEach(element => {
            if (element[3] == -1) {
                recipe_buy.push(
                    <tr className='tr-height' key={`buy-${element[0]}`}>
                        <td className='d-flex p-0'>
                            <ItemImage class={"mini-img"} id={element[0]} ign={element[1]} />
                            <h3 className='h3-head mt-auto mb-auto'>{element[1]}</h3>
                        </td>
                        <td className='position-relative p-0'>
                            <input
                                className='inp-field'
                                placeholder='craft'
                                value={inputValues[element[0]]?.craft || ''}
                                onChange={(e) => handleInputChange(e, element[0], 'craft')}
                            />
                        </td>
                        <td className='position-relative p-0'>
                            <input
                                className='inp-field'
                                placeholder='city buy'
                                value={inputValues[element[0]]?.cityBuy || ''}
                                onChange={(e) => handleInputChange(e, element[0], 'cityBuy')}
                            />
                        </td>
                    </tr>
                );
            }
        });
    }

    let recipe_craft = [];
    if (receiveData["recipe"] != undefined) {
        receiveData["recipe"]["craft"].forEach(element => {
            if (element[3] == -1) {
                recipe_craft.push(
                    <tr className='tr-height' key={`craft-${element[0]}`}>
                        <td className='d-flex p-0'>
                            <ItemImage class={"mini-img"} id={element[0]} ign={element[1]} />
                            <h3 className='h3-head mt-auto mb-auto'>{element[1]}</h3>
                        </td>
                        <td className='position-relative p-0'>
                            <input
                                className='inp-field'
                                placeholder='craft'
                                value={inputValues[element[0]]?.craft || ''}
                                onChange={(e) => handleInputChange(e, element[0], 'craft')}
                            />
                        </td>
                        <td className='position-relative p-0'>
                            <input
                                className='inp-field'
                                placeholder='city buy'
                                value={inputValues[element[0]]?.cityBuy || ''}
                                onChange={(e) => handleInputChange(e, element[0], 'cityBuy')}
                            />
                        </td>
                    </tr>
                );
            }
        });
    }

    return (
        <>
            <div className={`container-fluid panel-parent ${state == 0 ? "d-none" : ""}`}>
                <div className='panel'>
                    <div className='container'>
                        <button className='btn close-btn' onClick={closePopup}>X</button>
                        <div className='row'>
                            <div className='col'>
                                <ItemImage class={"img-head"} id={receiveData["id"]} ign={receiveData["ign"]} />
                                <h1 className='h1-head'>{receiveData["ign"]}</h1>
                            </div>
                        </div>
                        <div className='row'>
                            <div className='col'>
                                <div className='container scroll-popup' id='custom-scroll'>
                                    <table className='table table-striped table-dark'>
                                        <thead>
                                            <tr>
                                                <th>
                                                    <h2 className='h2-head'>Item</h2>
                                                </th>
                                                <th>
                                                    <h2 className='h2-head'>Price Buy</h2>
                                                </th>
                                                <th>
                                                    <h2 className='h2-head'>City buy</h2>
                                                </th>
                                            </tr>
                                        </thead>
                                        <tbody>
                                            {recipe_buy}
                                            {recipe_craft}
                                        </tbody>
                                    </table>
                                </div>
                            </div>
                        </div>
                        <button className='btn btn-primary modify-btn' onClick={handleItemChange}>Modify</button>
                    </div>
                </div>
            </div>
        </>
    );
}
